import React, { useState } from "react";
import { TextField, Container, } from "@mui/material";
import logoImage from "../../images/registration/CPlogo.png";
import loginBG from "../../images/registration/loginBG5.jpg";
import "../../styles/Login.css";


const Login: React.FC = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const navigate = useNavigate();

  const handleLogin = () => {
    navigate("/dashboard");
  };

  return (
    <div className="root-container" style={{ backgroundImage: `url(${loginBG})` }}>
      <Container className="login-container">
        <div className="login-box">
          <img
            src={logoImage}
            alt="Crashpad Logo"
            style={{ width: "50%", height: "auto", marginLeft: "6em" }}
          />
          <form noValidate autoComplete="off">
            <TextField
              fullWidth
              margin="normal"
              id="email"
              label="Username"
              variant="outlined"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
            <TextField
              fullWidth
              margin="normal"
              id="password"
              label="Password"
              type="password"
              variant="outlined"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
            <LoginButton
              fullWidth
              variant="contained"
              style={{ backgroundColor: "#FDA117" }}
              onClick={handleLogin}
            >
              Login
            </LoginButton>
            <Typography variant="body2" style={{ marginTop: "1em" }}>
              New to Crashpad?
              <Link to="/SignUp" style={{ textDecoration: "none" }}>
                Sign up here
              </Link>
            </Typography>
          </form>
      </div>
      </Container>
    </div>
  );
};

export default Login;
